import React, {useState} from "react";
import Box from "@mui/material/Box";
import Button from "@mui/material/Button";
import Card from "@mui/material/Card";
import PillLogo from './pill.svg';
import TextField from "@mui/material/TextField";

export default function Login() {
    const [username, setUsername] = useState("");
    const [password, setPassword] = useState("");

    const handleSubmit = e => {
        e.preventDefault();
        console.log(username, password);
    };

    function validateForm() {
        console.log("Is it validated?");
        return username === "test" && password === "pass";
    };

    const containerDiv = {
        alignItems: "center", display: "flex", flexDirection: "column", justifyContent: "center"
    }

    return (
        <div style={containerDiv}>
            <div>
                <img src={PillLogo} alt="Pill Logo" style={{
                    filter: "invert(100%) sepia(0%) saturate(0%) hue-rotate(231deg) brightness(103%) contrast(101%)",
                    height: "250px"
                }}/>
            </div>

            <Card variant="outlined" sx={{ml: 5, mt: 5, mr: 5, p: 5}}>
                <form onSubmit={handleSubmit}>
                    <Box
                        sx={{
                            "& .MuiTextField-root": {mb: 5, width: "100%"},
                        }}
                    >
                        <TextField
                            required
                            id="userInput"
                            name="userInput"
                            label="Username"
                            type="search"
                            value={username}
                            onChange={e => setUsername(e.target.value)}
                        />

                        <TextField
                            required
                            id="passwordInput"
                            name="passwordInput"
                            label="Password"
                            type="search"
                            value={password}
                            onChange={e => setPassword(e.target.value)}
                        />

                        <Button variant="contained" size="large" type="submit" disabled={!validateForm()}
                                sx={{fontSize: "17px", height: "5.75ch", width: "100%"}}>Login</Button>
                    </Box>
                </form>
            </Card>
        </div>
    );
}
